import React, { useState } from 'react'
import Sidebar from '../AdminComponents/SideBar/SideBar'
import Home from '../AdminComponents/Home/Home'
import AddPackages from '../AdminComponents/AddPackages/AddPackages';

function AdminDashboard() {

  const [selectedValue, setSelectedValue] = useState('');

  const handleSelectionChange = (value) => {
      setSelectedValue(value);
  };
  if(selectedValue==='Home'){
      selectedComponent=<Home/>
  }else if(selectedValue==='Profile'){
    selectedComponent=<Home/>
  }else if(selectedValue==='Packages'){
    selectedComponent=<AddPackages/>
  }
  return (
    <>
      <Sidebar onSelectionChange={handleSelectionChange}/>
     {selectedComponent}
      
      
    </>
  )
}

export default AdminDashboard
